  <React.StrictMode>
    <MoralisProvider appId="cZIfVQ7F9wLYaNHdLanP6jPjsbT4mr66H2ULFq38" serverUrl="https://isqp8vrjdkke.usemoralis.com:2053/server">
      <BrowserRouter>
          <App />
      </BrowserRouter>
    </MoralisProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
